in_code: |-
  ;fff
            .data
      .org 10000 ; -> максимальная длина передаваемого массива - 2500 32-битных чисел

  const_4:    .num    4
  const_1:    .num    1
  out:        .num    4 ; IO для чисел
  in:         .num    0

  count:      .num    0;  общее количество элементов
  el_count:   .num    0;  количество обработанных элементов
  p_el_count: .num    0;  количество элементов, которые надо переставить(стоящих правее добавленного элемента)
  nul_point:  .num    8;  константный ноль, указывающий на начало списка(8 из-за MMIO)
  cur_point:  .num    8;  текущее положение в списке
  cur_el:     .num    0;  текущий элемент
  buf_el:     .num    0; буфферный элемент, нужен при смещении элементов
  mask:       .num    255

      .text

  _start:
      read_ind    in
      write       count ;можно обработать ввод числа большего чем 2500, но это усложнит код и задание как-будто не про это

  first_iteration:
      read_ind    in
      write_ind   nul_point

  sort_preparing:
      read        el_count
      add         const_1
      write       el_count
      sub         count
      beq         output_answ

      read        nul_point
      write       cur_point

      read        el_count
      write       p_el_count

  sort_read:
      read_ind    in
      write       cur_el

  find_write_ind:;у нас есть cur_el, мы должны пометить в cur_point позицию, куда его надо вставить, а все остальное(остальные p_el_count) сдвинуть вправо

      read_ind    cur_point
      sub         cur_el
      not
      add         const_1 ;для вывода от меньшего к большему
      bne         write_element

      read        cur_point
      add         const_4
      write       cur_point

      read        p_el_count
      sub         const_1
      write       p_el_count
      beq         write_element


      jump        find_write_ind

  write_element:
      read_ind    cur_point
      write       buf_el
      read        cur_el
      write_ind   cur_point

      read        p_el_count
      beq         sort_preparing
      sub         const_1
      write       p_el_count

      read        cur_point
      add         const_4
      write       cur_point

      read        buf_el
      write       cur_el
      jump        write_element
  output_answ:
  loop:
      read_ind    nul_point
      write_ind      out
      read        nul_point
      add         const_4
      write       nul_point
      read        count
      sub         const_1
      beq         end
      write       count
      jump        loop
  end:
      halt

